int VersionCompare(string v1, string v2) 

{

    int n = v1.length();

    int m = v2.length();

    int i = 0,j = 0;

    string s1 = "",s2 = "";

    while(i<n || j<m){

        while(v1[i] != '.' && i<n){

            s1 += v1[i++];

        }

        while(v2[j] != '.' && j<m){

            s2 += v2[j++];

        }

        i++;

        j++;

        int val1 = s1=="" ? 0 : stoi(s1);

        int val2 = s2=="" ? 0 : stoi(s2);

        if(val1>val2){

            return 1;

        }else if(val1<val2){

            return -1;

        }

        s1 = "";

        s2 = "";

    }

    return 0;

}

